const ToSearch = () => {
    const [text, setText] = useState('');

    const onChage = (e) => {
        setText(e.target.value);
    };


    return (
        <>
        <input onChange={onChage} val={text} placeholder="검색어를 입력 하세요"/>
        <button> 검색 </button>

        </>

    )
}

export default ToSearch
